import React from 'react';

import Social from '../Login/Social/Social';
import '../auth.css';

const Wrapper = (props) => (
    <div className="Page">
        <div className="Register">
            {props.title ? 
                <div className="Register">
                    {props.form}
                </div> :
                <div className="Register">
                    {props.form}
                    </div>
            }
            {/* <div className="Login-wrapper">
                <h1 className="login-form-title">{props.title}</h1> */}
                {props.form}
                {/* {props.social && <Social />}
            </div> */}
        </div>  
    </div> 
)

export default Wrapper
